import React from 'react';
import './App.css';
import ReactCursorPosition, { INTERACTIONS } from 'react-cursor-position';
import pad_image_1 from "./color_2d_plot1.png";
import image_architecture from "./figure_with_LSR.png";
import ReactAudioPlayer from 'react-audio-player';


var metric1 = 300;
var metric2 = 300;
var metric3 = 300;
var metric4 = 300;
var file_index = 0;



function DisplayMetrics(props){
  return (
      <h1 className = 'display_metrics'> Metrics {props.m1} {props.m2} {props.m3} {props.m4} </h1>
  );

};

function TextInput(props){
  return (
      <h1 className = 'text_input'> Input MIDI </h1>
  );

};

function TextOutputVariations(props){
  return (
      <h1 className = 'text_output_variations'> Output MIDI (Input Variations) </h1>
  );

};

class Pad1 extends React.Component {

  render() {

    const { x } = x;
    const { y } = y;
    return (
      <ReactCursorPosition className="pad1"
       activationInteractionMouse={INTERACTIONS.CLICK}
      >
        <PositionLabel1 />
        <ImageComponent />
        <div onMouseMove={this._onMouseMove.bind(this)}>
        <h1>Mouse coordinates: { x } { y }</h1>
        </div>
      </ReactCursorPosition>

    );
  }
}

// class MousePosition extends React.Component {
//   constructor(props) {
//     super(props);

//     this.state = { x: 0, y: 0 };
//   }

//   _onMouseMove(e) {
//     this.setState({ x: e.screenX, y: e.screenY });
//   }

//   render() {
//     const { x, y } = this.state;
//     return <div onMouseMove={this._onMouseMove.bind(this)}>
//       <h1>Mouse coordinates: { x } { y }</h1>
//     </div>;
//   }
// }

const PositionLabel1 = (props) => {
  const {
    detectedEnvironment: {
      isMouseDetected = false,
      isTouchDetected = false
    } = {},
    elementDimensions: {
      width = 0,
      height = 0
    } = {},
    isActive = false,
    isPositionOutside = false,
    position: {
      x = 0,
      y = 0
    } = {}
  } = props;

  return (
    <div className="pad1__label">
      {`x: ${x}`}<br />
      {`y: ${y}`}<br />
      {`isActive: ${isActive}`}
      <h1>Mouse coordinates: { x } { y }</h1>
    </div>

  );
};

const ImageComponent = (props) => {
  return (
    <div className="imageDiv">
      <img src={pad_image_1} width="280" height="280" />
    </div>
  );

};

class Pad2 extends React.Component {
  render() {
    return (
      <ReactCursorPosition className="pad2"
       activationInteractionMouse={INTERACTIONS.CLICK}
      >
        <PositionLabel2 />
      </ReactCursorPosition>
    );
  }
}

const PositionLabel2 = (props) => {
  const {
    detectedEnvironment: {
      isMouseDetected = false,
      isTouchDetected = false
    } = {},
    elementDimensions: {
      width = 0,
      height = 0
    } = {},
    isActive = false,
    isPositionOutside = false,
    position: {
      x = 0,
      y = 0
    } = {}
  } = props;

  return (
    <div className="pad2__label">
      {`x: ${x}`}<br />
      {`y: ${y}`}<br />
      {`width: ${width}`}<br />
      {`height: ${height}`}<br />
      {`isActive: ${isActive}`}<br />
      {`isPositionOutside: ${isPositionOutside ? 'true' : 'false'}`}<br />
      {`isMouseDetected: ${isMouseDetected ? 'true' : 'false'}`}<br />
            {`isTouchDetected: ${isTouchDetected ? 'true' : 'false'}`}
    </div>
  );
};

function Audio_Player_Source(props){
  var mp3_file_name = props.name;

  return (
    <ReactAudioPlayer
        className = "audio_player_source"
        src = {mp3_file_name}
        controls
    />
  );
}

function Audio_Player_Generated(props){
  var mp3_file_name = "./mp3_files/midi_1.mp3";
  var file_index_1 = 1;
  var file_index_2 = 2;

  if (props.m1 > 200 && props.m2 > 200 && props.m3 > 200 && props.m4 > 200){
    mp3_file_name = "./mp3_files/midi_" + file_index_1 + ".mp3";

  }
  else if (props.m1 < 200 && props.m2 < 200 && props.m3 < 200 && props.m4 < 200){
    mp3_file_name = "./mp3_files/midi_" + file_index_2 + ".mp3";

  }

  return (
    <ReactAudioPlayer
        className = "audio_player_generated"
        src = {mp3_file_name}
        controls
    />
  );
}

function ImageComponentArchitecture(props){
  return (
    <div className="image_architecture">
      <img src={props.name} width="943" height="264" />
    </div>
  );

};

class X1_label extends React.Component {
  render() {
    return (
      <h1 className = 'x1_label' > Rhythmic Complexity Level <br/> Latent Dimension = 0</h1>
    );
